import React from "react";
import { NavLink } from "react-router-dom";
class Exams extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
           Exam:''
        };
    }

    handleSubmit = (e) => {
        this.setState({
          Exam:e.target.value
        }, () => {
            console.log(this.state.Exam);
        });
    }

    render() {
        return (
            <>
                  <NavLink to={'/'}>
          <button>Set-Role</button>
        </NavLink >
            <select onChange={this.handleSubmit}>
                  <option value=''>Select Exam</option>
                <option value={'CFA-I'}>CFA-I</option>
                <option value={'CFA-II'}>CFA-II</option>
                <option value={'CFA-III'}>CFA-III</option>

            </select>

        <NavLink to={'/User'}>
        <button>User</button>
        </NavLink>
        </>
        );

    }
}

export default Exams ;
